import React from "react";
import Jumbotron from '../Jumbotron';
import CurrencyInputPanel from '../CurrencyInputPanel';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles((theme) => ({
    main: {
        marginBottom: theme.spacing(2),
        height: '8rem',
        padding: '2rem 2rem 3rem 2rem',
        boxShadow: 'rgba(200, 210, 225, 0.698) 4px 6px 23px 0px, rgb(200, 210, 225) 1px 2px 4px 0px',
    },
    text: {
        fontWeight: '600',
        color: '#505050'
    },
}));

export default function SwapPage() {
    const classes = useStyles();
    return (
        <div>
            <Container component="main" className={classes.main} maxWidth='false' noWrap='true'>
                <Typography variant="h4" component="h4" className={classes.text}>
                    Swap
                </Typography>
                <Typography variant="subtitle1" component="h2" className={classes.text}>
                    {'Buy or sell SYC tokens. SYC tokens grant you proportional power in the mutual.'}
                </Typography>
            </Container>
            <CurrencyInputPanel />
        </div>
    );
}
